import React from "react";
import Slider from "@mui/material/Slider";

export default function PriceSlider({ value, onChange, disabled }) {
  return (
    <div className="price-slider" style={{ display: "flex", alignItems: "center", gap: "10px" }}>
      <span>{value[0]}</span>
      <Slider
        value={value}
        onChange={onChange}
        valueLabelDisplay="auto"
        min={0}
        max={999}
        disableSwap
        disabled={disabled}
        style={{ flex: 1 }}
      />
      <span>{value[1]}</span>
    </div>
  );
}
